// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "./lib/slugify.sol";
import "./authors.sol";

contract Article {
    uint public no_of_articles = 0;
    Author public author;
    string[] public articleSlugs;
    bytes32 private constant HASH_1D = keccak256(abi.encodePacked("1D"));
    bytes32 private constant HASH_1M = keccak256(abi.encodePacked("1M"));
    bytes32 private constant HASH_3M = keccak256(abi.encodePacked("3M"));
    bytes32 private constant HASH_1Y = keccak256(abi.encodePacked("1Y"));

    struct User{
        address userAddress;
        string name;
        string title; 
        string description;
        uint balance;
        uint256 createdAt;
    }
    struct IArticle {
        uint id;
        string imageCID;
        string title;
        string slug;
        string description;
        string[] tags;
        string content;
        string authorName;
        address authorAddress;
        uint gifts;
        uint256 createdAt;
    }

    mapping(string => IArticle) public articles;

    // Constructor to set Author contract address
    constructor(address _authorContractAddress) {
        author = Author(_authorContractAddress);
    }

    function addArticle(
        address _authorAddress,
        string memory _title,
        string memory _imageCID,
        string memory _description,
        string[] memory _tags,
        string memory _content
    ) public payable {
        string memory slugged = Slugify.generateSlug(_title);
        require(articles[slugged].authorAddress == address(0), "Article with this slug already exists");
        Author.User memory getAuthorForName = author.getAuthor(_authorAddress);
        require(bytes(getAuthorForName.name).length > 0, "Author name is missing");
        
        articles[slugged] = IArticle(
            no_of_articles,
            _imageCID,
            _title,
            slugged,
            _description,
            _tags,
            _content,
            getAuthorForName.name,
            _authorAddress,
            0,
            block.timestamp
        );

        articleSlugs.push(slugged);
        no_of_articles++;
    }

    function editArticle(
        address _authorAddress,
        string memory _slug,
        string memory _newTitle,
        string memory _newImageCID,
        string memory _newDescription,
        string[] memory _newTags,
        string memory _newContent
    ) public {
        require(articles[_slug].authorAddress != address(0), "Article with this slug does not exist");
        require(articles[_slug].authorAddress == _authorAddress, "Only the author can edit this article");

        IArticle storage articleToEdit = articles[_slug];

        articleToEdit.title = _newTitle;
        articleToEdit.imageCID = _newImageCID;
        articleToEdit.description = _newDescription;
        articleToEdit.tags = _newTags;
        articleToEdit.content = _newContent;

        string memory newSlug = Slugify.generateSlug(_newTitle);
        if (keccak256(abi.encodePacked(newSlug)) != keccak256(abi.encodePacked(_slug))) {

            require(articles[newSlug].authorAddress == address(0), "An article with the new slug already exists");

            articles[newSlug] = articleToEdit;
            delete articles[_slug];
            articleToEdit.slug = newSlug;

            for (uint i = 0; i < articleSlugs.length; i++) {
                if (keccak256(abi.encodePacked(articleSlugs[i])) == keccak256(abi.encodePacked(_slug))) {
                    articleSlugs[i] = newSlug;
                    break;
                }
            }
        }
    }

    function deleteArticle( string memory _slug) public {
        require(articles[_slug].authorAddress != address(0), "Article with this slug does not exist");
        delete articles[_slug];
            
        for (uint i = 0; i < articleSlugs.length; i++) {
            if (keccak256(abi.encodePacked(articleSlugs[i])) == keccak256(abi.encodePacked(_slug))) {
                articleSlugs[i] = articleSlugs[articleSlugs.length - 1];
                articleSlugs.pop();
                break;
            }
        }

        if (no_of_articles > 0) {
            no_of_articles--;
        }
    }

    function incrementArticleGifts(string memory _articleSlug) public {
        require(articles[_articleSlug].authorAddress != address(0), "Article with this slug does not exist");
        articles[_articleSlug].gifts++;
    }

    function getArticleAuthor(string memory _articleSlug) public view returns (address) {
        require(articles[_articleSlug].authorAddress != address(0), "Article with this slug does not exist");
        return articles[_articleSlug].authorAddress;
    }

    function getArticles(string memory _range) public view returns (IArticle[] memory) {
        bytes32 rangeHash = keccak256(abi.encodePacked(_range));
        uint256 timeRange;

        if( rangeHash == HASH_1D){
            timeRange = 1 * 24 * 60 * 60;
        } else if( rangeHash == HASH_1M){
            timeRange = 1 * 30 * 24 * 60 * 60;
        } else  if( rangeHash == HASH_3M){
            timeRange = 3 * 24 * 60 * 60;
        } else if( rangeHash == HASH_1Y){
            timeRange = 365 * 24 * 60 * 60;
        } else {
            timeRange = 0;
        }

        IArticle[] memory articlesArray = new IArticle[](no_of_articles);
        uint256 currentTime = block.timestamp;

        for (uint i = 0; i < no_of_articles; i++) {
            IArticle storage article = articles[articleSlugs[i]];
            if(timeRange == 0 || (currentTime - article.createdAt) <= timeRange){
                articlesArray[i] = article;
            }
        }

        return articlesArray;
    }

    function getNoOfArticles() public view returns (uint) {
        return no_of_articles;
    }

    function getArticle(string memory _slug) public view returns (IArticle memory) {
        require(articles[_slug].authorAddress != address(0), "Article with this slug does not exist");
        IArticle memory article = articles[_slug];
        return article;
    }
}

contracts/authors.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

contract Author{
    uint public no_of_authors = 0;
    address[] public authorAddresses;

    struct User{
        address userAddress;
        string name;
        string title; 
        string description;
        uint balance;
        uint256 createdAt;
    }

    mapping (address => User) public authors;

    function createAuthor() public payable {
        require(authors[msg.sender].userAddress == address(0), "User already exist");
        no_of_authors ++;
        authors[msg.sender] = User(msg.sender,"","","",0, block.timestamp);
        authorAddresses.push(msg.sender);
    }

    function setProfile( 
        address _userAddress, 
        string memory _name,
        string memory _title,
        string memory _description
    ) public {
        require(authors[_userAddress].userAddress != address(0), "User does not exist");
        authors[_userAddress].name = _name;
        authors[_userAddress].title = _title;
        authors[_userAddress].description = _description;
    }

    function incrementAuthorBalance(address _authorAddress, uint _amount) public payable  {
        require(authors[_authorAddress].userAddress != address(0), "Author does not exist");
        require(msg.value == _amount, "Ether sent does not match the amount");

        ( bool success, ) = _authorAddress.call{ value: msg.value }("");
        require(success, "Transfer failed.");

        User storage user = authors[_authorAddress];
        user.balance += _amount;
    }

    function getAuthors() public view returns (User[] memory) {
        User[] memory authorList = new User[](no_of_authors);

        for (uint i = 0; i < no_of_authors; i++) {
            User storage user = authors[authorAddresses[i]];
            authorList[i] = user;
        }

        return  authorList;
    }

    function getAuthor(address userAddress) public view returns (User memory) {
        require(userAddress != address(0), "Invalid Address");
        User memory user = authors[userAddress];
        return user;
    }

}

contracts/gifts.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >= 0.7.0 < 0.9.0;
import "./authors.sol";
import "./articles.sol";

contract Gift{
    uint public no_of_gifters = 0;
    Article article;
    Author author;

    struct IGift{
        address userAddress;
        address authorAddress;
        string articleSlug;
        uint amount;
        uint256 createdAt;
    }

    mapping (uint => IGift) public giftCollection;
    mapping (address => mapping (string => bool)) public hasGifted;

    function sendGift(
        string memory _articleSlug,
        uint _amount
    ) public payable {

        require(!hasGifted[msg.sender][_articleSlug], "You have already gifted this article");

        hasGifted[msg.sender][_articleSlug] = true;
        address authorAddress = article.getArticleAuthor(_articleSlug);
        
        author.incrementAuthorBalance{value: _amount}(authorAddress, _amount);
        article.incrementArticleGifts(_articleSlug);

        giftCollection[no_of_gifters] = IGift(
            msg.sender,
            authorAddress,
            _articleSlug,
            _amount,
            block.timestamp
        );

        no_of_gifters ++;

    }

    function getAuthorGifters(address authorAddress) public view returns (IGift[] memory){
        IGift[] memory authorGifts = new IGift[](no_of_gifters);

        for(uint i = 0; i < no_of_gifters; i++){
            if(giftCollection[i].authorAddress == authorAddress){
                authorGifts[i] = giftCollection[i];
            }
        }
        
        return  authorGifts;
    }

    function getGifts() public view returns (IGift[] memory){
        IGift[] memory gifts = new IGift[](no_of_gifters);

        for(uint i = 0; i < no_of_gifters; i++){
                gifts[i] = giftCollection[i];
        }
        
        return  gifts;
    }

    function getGift(uint index) public view returns (IGift memory) {
        require(giftCollection[index].authorAddress != address(0), "Invalid Gift");
        IGift memory gift = giftCollection[index];
        return gift;
    }
}

